import React, {Component} from 'react';
import '../scss/body.scss'

import Operation from "../AddComponents/Operation";
import Nav from "../AddComponents/Nav";


class Body extends Component {
    render() {
        return (
            <div className='body'>

                <Nav />
                <Operation />
            </div>
        );
    }
}

export default Body;
